c, and environmental conditions in the South, through promotion of local, national, regional and international initiatives in the household energy sector.\"','http://www.hedon.info/goto.php/HEDONForumMainPage',NULL,NULL,NULL,NULL,'2006-04-18 11:05:01','2006-04-18 11:05:01'),(27,3,'Eco Ltd','eco_ltd','health','\"Eco is a consultant firm based in London, England that brings together energy, sustainable development and information technology. The company focuses on project, market, and business development. Eco aims to empower local communities and organizations, has extensive experience in renewable energy, project development, project management, and in information technology, and is designer and sponsor of the HEDON internet pages.\"','http://ecoharmony.com/Home',NULL,NULL,NULL,NULL,'2006-04-18 11:22:33','2006-04-18 11:22:33'),(28,1,'greenguy.co.uk','greenguycouk','','\"A UK blog devoted to green and ethical things that you can do and buy without changing your entire life - \'ethical stuff that anyone can do\'.\"','http://greenguy.co.uk/',NULL,NULL,NULL,NULL,'2006-04-19 13:52:04','2006-04-19 13:52:04'),(29,1,'Cycloc','cycloc','','\"In towns and cities, where cycling is the answer to your transport needs,\r\nCycloc provides the practical solution to storing your bike in your home.\r\nBuy a Cycloc and instantly free-up floor space, so you can win back your hallway. And Cycloc\'s subtle design looks good too - you can even choose a colour to complement your interior.\"','http://www.cycloc.com/',NULL,NULL,NULL,NULL,'2006-04-19 13:57:32','2006-04-19 13:57:32'),(30,1,'Hug.co.uk','hugcouk','family','\"Fair Trade fashion for kids\"','http://www.hug.co.uk/shop/shopdisplaysubcat.asp?id=3&cat=kids',NULL,NULL,NULL,NULL,'2006-04-19 14:01:21','2006-04-19 14:01:21'),(31,1,'Bynature.co.uk - organic & ethical living','bynaturecouk__organic__ethical_living','family','\"green living in style... no compromise\"','http://www.bynature.co.uk/',NULL,NULL,NULL,NULL,'2006-04-19 14:04:12','20