ctions of hazardous substances (RoHS) in California and Europe.\"','http://www.treehugger.com/files/2006/04/apple_says_ipod_1.php',NULL,NULL,NULL,NULL,'2006-04-23 15:01:19','2006-04-23 15:01:18');
